import React, {Component} from 'react';

class Profile extends Component {
    render() {
        return (
            <div className="profile-main-container">
                <h1>Profile</h1>
                <label htmlFor="input">
                    User Name
                    <input id="input"
                           type="text"
                           placeholder="Yonatan"
                    />
                </label>
            </div>
        );
    }
}

export default Profile;
